tinymce.PluginManager.add("wfc", function (t, e) {
    function n() {
        var t;
        return t = '<table role="presentation" class="mce-grid">', tinymce.each(i, function (n) {
            t += "<tr>", t+='<td><a href="#" data-mce-url="' + n + '" tabindex="-1">['+n+']</a></td>'
            , t += "</tr>"
        }), t += "</table>"
    }

    var i = [
        ["month"],
        ["year"],
        ["users"],
        ["sessions"],
        ["bouncerate"],
        ["bounces"],
        ["avg_session_duration"],
        ["percent_new_sessions"],
        ["referral_traffic"],
        ["mobile_traffic"],
        ["geo_summary"],
        ["geo_city_summary"],
        ["visitor_overview"],
        ["top_pages"],
        ["exit_pages"],
        ["site_speed"],
        ["acquisition_overview"],
        ["search_engine_traffic"],
        ["new_vs_returning_table"]
    ];
    function getFull(n){
        var xmlhttp;
        xmlhttp=new XMLHttpRequest();
        xmlhttp.open("GET",'shortcode.ajax.php?s=' + n + '&t=' + Math.random(),false);
        xmlhttp.send();
        return xmlhttp.responseText;
    }
    t.addButton("wfc", {
        type: "panelbutton",
        panel: {
            autohide: !0,
            html: n,
            onclick: function (e) {
                var n = t.dom.getParent(e.target, "a");
                n && (t.insertContent('['+n.getAttribute("data-mce-url")+']'), this.hide())
            }
        },
        tooltip: "WFC Shortcodes"
    })
});